/*
	RaceCarImageService: serves images related to race cars
*/
var ImageService = function($http) {

		var images = { 
		  "Ford":       		"http://static.nascar.com/content/dam/nascar/articles/sidebar%20content/Ford.png",
		  "Chevrolet":  		"http://static.nascar.com/content/dam/nascar/articles/sidebar%20content/Chevy.png",
		  "Toyota":     		"http://static.nascar.com/content/dam/nascar/articles/sidebar%20content/Toyota.png",
		  "McDonald's": 		"http://logodesignconsultant.com/blog/wp-content/uploads/2010/05/mcdonalds-logo.jpg",
		  "M&Ms": 				"http://www.mars.com/global/assets/images/center-content/mms.png",
		  "Lowe's": 			"data:image/png;base64,",
		  "GoDaddy": 			"https://lh5.googleusercontent.com/-4ELwL_o47R8/AAAAAAAAAAI/AAAAAAAAAAA/MQHqKH-O6ng/s0-c-k-no-ns/photo.jpg",
		  "Mobil": 				"http://www.sportsandentertainmentnews.com/nazphotopr/mobil_color1o5.gif",
		  "Best Buy": 			"data:image/png;base64,",  
		  "Diet Mountain Dew": 	"data:image/jpeg;base64,",
		  "The Home Depot": 	"data:image/png;base64,",
		  "Hertz": 				"data:image/jpeg;base64,",
		  "Rheem": 				"data:image/jpeg;base64,",
		  "Motorcraft": 		"https://encrypted-tbn3.gstatic.com/images?q=tbn:ANd9GcThG2R0Au5GnTrHvP1mUlB1zVs1RFsBG5DFuZaBWqeP_pQQBpkp_w",
		  "Du Pont": 			"data:image/png;base64,",
		  "Advocare": 			"http://www.gototalbody.com/wp-content/uploads/2015/06/advocare1.jpg",
		  "Cheerios": 			"http://www.generalmillscf.com/services/GetMedia.ashx?mediaId=d6d5823e-54a4-45b9-961b-9395aea7a27f",
		  "Jimmy John's": 		"data:image/png;base64,",
		  "Smithfield": 		"http://feedstuffs.com/cdfm/Feeess50/author/303/22659466_BG1.jpg",
		  "Haas": 				"https://upload.wikimedia.org/wikipedia/en/b/b5/Haas_Automation,_Inc._Logo.jpg",
		  "Great Clips": 		"http://i117.photobucket.com/albums/o54/north-florida/Review/Great20Clips_logowithtag_black.jpg",
		  "Aarons": 			"",
		  "Miller Lite":        "http://northwoodsleague.com/kalamazoo-growlers/wp-content/uploads/sites/13/2014/05/miller_lite_logo1.jpg",
		  "Geico": 				"http://www.findthatlogo.com/wp-content/uploads/2011/09/geico-logo.jpg",
		  "FedEx Express":  	"http://www.pasadenashipping.com/Flash/FedEx_express.jpg"
		};

		var service = this;

		// define handler mechanism
		service.all = function() {
			// load image map from $http		
			return $http.get('data/racecarimages.json')
				.then(
					function(result){
						return result;
					}
				);
		};

		var getImageSource = function(make) {
			return images[make];
		};

		service.loadImages = function(map) {
			images = map;
		}

		var init = function() {
			service.all().then(
				function(result) {
					service.loadImages(result.data.images);
				}
			);
		}

		// return public interface
		return {
			init: 			init,
			getImageSource: getImageSource
		}
	
};
